import React from "react";

class Input extends React.Component {
  constructor(props) {
    super(props);
  }

  render(ev) {
    const userValue = ev.target.value;
    return (
      <>
        <textarea value={userValue}> </textarea>
        <p>{userValue}</p>
      </>
    );
  }
}

export default Input;
